      <div>
        <img onClick={clicker2} src={bandicoot} alt="bandicoot" />
        <span>Bandicoot</span>
      </div>
      <div>
        <img onClick={clicker3} src={pikachu} alt="pikachu" />
        <span className="p">Pikachu</span>
      </div>
    </div>
  );
}
